import React from "react";
import { Link } from "react-router-dom";
import Logo from "../Images/favicon.svg"

function Header() {
  return (
    <div className="header">
      <Link>
        to="#"
        <img src={Logo} width="80" height="32" alt="Flicks home"/>
      </Link>
    </div>
  );
}

export default Header;
